import React from 'react';
import styled from 'styled-components';

function ProductInfo() {
	return (
		<Wrapper>
			<Type>
				<h1>
					<span>Skin</span>
					<span>Cleanse</span>
				</h1>
			</Type>
			<Name></Name>
			<Desc></Desc>
		</Wrapper>
	);
}

export default ProductInfo;

const Wrapper = styled.div`
	display: flex;
	flex-direction: column;
	justify-content: flex-start;
	align-items: flex-start;
`;
